pragma solidity ^0.5.0;

contract WithoutSol {

    struct Player{
        address player;
        uint guessNum;
        uint bet;

    }
    uint public max_players;
    Player[] public players;
    address[] playerAddress;

    constructor() public{
      max_players = 10;
    }
    function joinGame(address adr,uint guessnum, uint bet) public payable{
        if(!checkDuplicate(adr) && players.length<3){
        Player memory p1 = Player(address(0),0,0);
        p1.player = adr;
        p1.guessNum = guessnum;
        p1.bet = bet;
        playerAddress.push(adr);
        if(players.length < 3){
            players.push(p1);
        }else{
           // delete players;
        }
        }

    }
    function getPlayerAddress() public view returns (address[] memory){

            return playerAddress;

    }
    function checkDuplicate(address adr) public view returns(bool){
        for(uint i=0; i<players.length; i++){
            if(adr == players[i].player){
                return true;
            }else{
                return false;
            }
        }
    }


}
